"use strict";(self.webpackChunkmy_website=self.webpackChunkmy_website||[]).push([[518],{4369:n=>{n.exports=JSON.parse('{"archive":{"blogPosts":[{"id":"dsa-javascript-array","metadata":{"permalink":"/dsa-javascript-array","source":"@site/blog/2025-09-20-dsa-javascript-array.md","title":"\u7528 JavaScript \u5be6\u4f5c Array \u8cc7\u6599\u7d50\u69cb","description":"\u9996\u7bc7 Data Structure \u60f3\u8981\u4ecb\u7d39\u7684\u662f Array\uff0c\u5728 JavaScript \u7576\u4e2d\uff0c\u56e0\u70ba\u5df2\u7d93\u6709\u5167\u5efa\u7684 Array \u8cc7\u6599\u7d50\u69cb\uff0c\u56e0\u6b64\u5e73\u5e38\u5df2\u7d93\u7fd2\u6163let array = [];\u9019\u7a2e\u5beb\u6cd5\u3002","date":"2025-09-20T00:00:00.000Z","tags":[{"inline":false,"label":"Data Structure and Algorithm","permalink":"/tags/data-structure-and-algorithm","description":"Data Structure and Algorithm"}],"readingTime":3.06,"hasTruncateMarker":true,"authors":[{"name":"Claudia Teng","title":"Author","imageURL":"https://github.com/Claudia-teng.png","key":"claudia","page":null}],"frontMatter":{"slug":"dsa-javascript-array","title":"\u7528 JavaScript \u5be6\u4f5c Array \u8cc7\u6599\u7d50\u69cb","authors":["claudia"],"tags":["dsa"]},"unlisted":false},"content":"\u9996\u7bc7 Data Structure \u60f3\u8981\u4ecb\u7d39\u7684\u662f Array\uff0c\u5728 JavaScript \u7576\u4e2d\uff0c\u56e0\u70ba\u5df2\u7d93\u6709\u5167\u5efa\u7684 Array \u8cc7\u6599\u7d50\u69cb\uff0c\u56e0\u6b64\u5e73\u5e38\u5df2\u7d93\u7fd2\u6163`let array = [];`\u9019\u7a2e\u5beb\u6cd5\u3002\\n\\n\u4e0d\u904e JavaScript \u7684 Array \u5176\u5be6\u4e5f\u662f\u5f9e Object \u884d\u751f\u800c\u4f86\uff0c\u5982\u679c\u4eca\u5929\u5728 console \u8f38\u5165`typof []`\uff0c\u4f60\u6703\u5f97\u5230`\'object\'`\u7684\u7b54\u6848\uff0c\u539f\u56e0\u662f\u5728 JavaScript \u4e2d\uff0cArray \u7b97\u662f\u7279\u5225\u7684 Object\u3002\\n\\nArray \u8cc7\u6599\u7d50\u69cb\u5176\u5be6\u4e5f\u80fd\u900f\u904e JavaScript \u81ea\u5df1\u5be6\u4f5c\uff0c\u4ee5\u4e0b\u5c07\u6703\u793a\u7bc4\u600e\u9ebc\u900f\u904e Object \u4f86\u5be6\u4f5c Array\uff0c\u4ee5\u53ca\u81ea\u5df1\u5beb\u51fa\u4e00\u4e9b\u5e38\u898b\u7684 Array Method\u3002\\n\\n\u63a5\u4e0b\u4f86\u5c31\u4e00\u8d77\u4f86\u5be6\u4f5c\u5427\uff01\\n\\n\x3c!-- truncate --\x3e\\n\\n### Array\\n\\n\u9996\u5148\u5efa\u7acb\u4e00\u500b`Class`\u53eb\u505a MyArray\uff0c\u4e26\u5728`constructor`\u5167\u9810\u8a2d\u5169\u500b\u503c\uff1alength, data\uff0c\u4f5c\u70ba\u7a7a\u9663\u5217\u3002\\n\\n```jsx\\nclass MyArray {\\n  constructor() {\\n    this.length = 0;\\n    this.data = {};\\n  }\\n}\\n```\\n\\n\u63a5\u4e0b\u4f86\u6211\u5011\u8981\u5728 MyArray \u88e1\u9762\u52a0\u5165\u4e00\u4e9b method\uff1a\\n\\n### Get\\n\\n\u5148\u4f86\u5be6\u4f5c\u5982\u4f55\u85c9\u7531 index\uff0c\u53d6\u5f97 Array \u88e1\u76f8\u5c0d\u61c9\u7684\u503c\uff0c\u4f7f\u7528\u7684\u662f`Object[key]`\u7684\u65b9\u5f0f\u3002\\n\\n```jsx\\nget(index) {\\n  return this.data[index]\\n}\\n```\\n\\nBig O: O(1)\\n\\nArray \u56e0\u70ba\u6709 index\uff0c\u56e0\u6b64\u641c\u5c0b\u901f\u5ea6\u5f88\u5feb\u3002\\n\\n### Push\\n\\nArray.push()\u662f\u5728 array \u7684\u6700\u5f8c\u9762\u52a0\u4e00\u500b\u503c\uff0c\u4e26\u56de\u50b3\u6574\u500b array\uff0c\u5be6\u4f5c\u5982\u4e0b\uff1a\\n\\n```jsx\\npush(item) {\\n  this.data[this.length] = item;\\n  this.length++;\\n  return this.data;\\n}\\n```\\n\\nBig O: O(1)\\n\\n\u901a\u5e38\u70ba O(1)\uff0c\u53ea\u9700\u5728\u6700\u5f8c\u52a0\u4e0a\u503c\uff0c\u4e0d\u7528\u6539\u8b8a\u6574\u500b\u7d50\u69cb\u3002\u4f46 Array \u5728 RAM \u5132\u5b58\u503c\u7684\u65b9\u5f0f\u70ba\u9023\u7e8c\u7684\uff0c\u82e5 Array \u672b\u7aef\u6c92\u6709\u7a7a\u9593\u653e\u6700\u5f8c\u4e00\u500b\u503c\uff0c\u5247\u9808\u5c07\u6574\u500b Array \u642c\u79fb\u5230 RAM \u5176\u4ed6\u8655\uff0c\u6b64\u6642 Big O: O(n)\u3002\\n\\n### Pop\\n\\nArray.pop()\u662f\u79fb\u9664 array \u6700\u5f8c\u4e00\u500b\u503c\uff0c\u4e26\u56de\u50b3\u88ab\u79fb\u9664\u7684\u503c\uff0c\u5be6\u4f5c\u5982\u4e0b\uff1a\\n\\n```jsx\\npop() {\\n  const lastItem = this.data[this.length - 1];\\n  delete this.data[this.length - 1];\\n  this.length--;\\n  return lastItem;\\n}\\n```\\n\\n\u9019\u88e1\u4f7f\u7528\u5230\u7684\u662f Object \u7684\u522a\u9664\u65b9\u5f0f`delete Object[key]`\u3002\\n\\nBig O: O(1)\\n\\n\u53ea\u9700\u79fb\u9664\u6700\u5f8c\u4e00\u500b\u503c\uff0c\u4e0d\u7528\u6539\u8b8a\u5176\u4ed6\u7d50\u69cb\u3002\\n\\n### Delete\\n\\n\u6700\u5f8c\u4f86\u5be6\u4f5c\u5982\u4f55\u79fb\u9664 Array \u4e2d\u7279\u5b9a index \u7684\u503c\uff0c\u4e26\u56de\u50b3\u88ab\u79fb\u9664\u7684\u503c\u3002\\n\\n\u9019\u908a\u5be6\u4f5c\u7684\u65b9\u6cd5\u662f\uff0c\u5c07\u7d66\u4e88\u7684 index \u503c\u63db\u6210 index+1 \u7684\u503c\u3002\\n\\n\u4f8b\u5982\uff1a\\n\\n```jsx\\nlet array = [45, 26, 33, 42, 55];\\n// index      0   1   2   3   4\\n```\\n\\n\u82e5\u6211\u4eca\u5929\u60f3\u79fb\u9664 index 3 (\u503c\u70ba 42)\uff0c\u6211\u5fc5\u9808\u5c07 index 3 \u6240\u5c0d\u61c9\u7684\u503c\u63db\u70ba 55 (\u4e5f\u5c31\u662f\u539f\u672c\u7684 index 4)\uff0c\u5c07\u5f8c\u9762\u4e00\u500b\u66ff\u88dc\u4e0a\u53bb\u7684\u610f\u601d\u3002\\n\\n```jsx\\nlet array = [45, 26, 33, 42, 55];\\n// index      0   1   2   3   4\\n```\\n\\n\u800c\u79fb\u9664\u5f8c\u4e5f\u8981\u8a18\u5f97\u5c07\u6700\u5f8c\u4e00\u500b\u503c\u522a\u9664\u3002\\n\\n```jsx\\nlet array = [45, 26, 33, 55];\\n// index     0   1   2   3\\n```\\n\\n\u5be6\u4f5c\u5982\u4e0b\uff1a\\n\\n```jsx\\ndeleteAtIndex(index) {\\n  const item = this.data[index];\\n  for (let i = index; i < this.length - 1; i++) {\\n    // this.length - 1 \u662f\u56e0\u70baarray\u6700\u5f8c\u4e00\u500bindex\u4e0d\u7528\u505a\u66ff\u88dc\u7684\u52d5\u4f5c\\n    this.data[i] = this.data[i + 1];\\n  }\\n  // \u522a\u9664\u6700\u5f8c\u4e00\u500b\\n  delete this.data[this.length - 1];\\n  this.length--\\n  return item;\\n}\\n```\\n\\n\u6216\u662f\u6bd4\u8f03\u7c21\u6f54\u7684\u5beb\u6cd5\uff0c\u628a\u4e2d\u9593\u7684\u904e\u7a0b\u79fb\u51fa\u4f86\u8b8a\u6210\u4e00\u500b function\u3002\\n\\n```jsx\\ndeleteAtIndex(index) {\\n  const item = this.data[index];\\n  this.shiftItems(index);\\n  return item;\\n}\\n\\nshiftItems(index) {\\n  for (let i = index; i < this.length - 1; i++) {\\n    this.data[i] = this.data[i + 1];\\n  }\\n  delete this.data[this.length - 1];\\n  this.length--;\\n}\\n\\n```\\n\\nBig O: O(n)\\n\\nindex \u4e4b\u5f8c\u7684\u7d50\u69cb\u90fd\u6703\u6539\u8b8a\uff0c\u53c8\u56e0 Big O \u8003\u616e\u7684\u662f\u6700\u5dee\u60c5\u6cc1\uff0c\u82e5 index = 0\uff0c\u6574\u500b Array \u7d50\u69cb\u90fd\u9808\u6539\u8b8a\uff0c\u56e0\u6b64\u70ba O(n)\u3002\\n\\n\u6700\u5f8c\u5373\u53ef\u547c\u53eb MyClass \u7684 method\uff1a\\n\\n```jsx\\nconst myArray = new MyArray();\\n\\nmyArray.push(\\"Hellooo\\");\\nmyArray.push(\\",\\");\\nmyArray.push(\\"Nice\\");\\nmyArray.push(\\"to\\");\\nmyArray.push(\\"meet\\");\\nmyArray.push(\\"you\\");\\nmyArray.pop();\\nmyArray.deleteAtIndex(0);\\nmyArray.push(\\"!\\");\\nmyArray.shiftItems(0);\\n```\\n\\n\u4ee5\u4e0a\u5c31\u662f\u81ea\u5df1\u7528 JavaScript Object \u5be6\u4f5c Array \u8cc7\u6599\u7d50\u69cb\uff0c\u548c\u4e00\u4e9b\u7c21\u55ae\u7684 method \u7684\u65b9\u5f0f\uff01\\n\\n### Pros & Cons\\n\\n1. Pros\\n\\n   Good at having sorted data (ordered)\\n\\n   Fast lookup\\n\\n   Fast push/pop\\n\\n   Ordered\\n\\n2. Cons\\n\\n   Slow Search (find value) O(n)\\n\\n   Slow inserts O(n)\\n\\n   Slow deletes O(n)\\n\\nhttps://www.google.com/maps"}]}}')}}]);